const PATH = require( 'path' );
const FS = require( 'fs' );
const MKDIRP = require( 'mkdirp' );
const REMOTE = require('electron').remote;
const HJSON = require( 'hjson' );
const EXEC = require( 'child_process' );
const JSZIP = require( 'jszip' );
const AOZIO = require( '../aoz-io' );
const AOZCert = require( '../aoz-cert.js' );
const { postUpdater } = require( '../updater/post-updater' );

const { authenticateToken, checkSerial, getAuthorCertificate } = require( '../licenceChecker.js' );

var Splash = function( panels )
{
	this.panels = panels; 
	this.panel = this.panels.createPanel(
		{
			id: 'splash_screen',
			title: '',
			width: 655,
			height: 361
		}
	);
	this.panel.module = this;
	
	var img = this.panels.createImage(
		{
			image: ( atom.edu ) ? Splash.IMAGE_EDU : Splash.IMAGE
		}
	);
	img.module = this;

	this.panel.focus();
	var self = this;	
	img.addEventListener( 'click', function()
	{
		self.hide();	
	}, false);
	
	this.panel.appendChild( img );
	
	var txtVersion = document.createElement( 'div' );
	txtVersion.innerHTML = 'V' + atom.appVersion;
	txtVersion.setAttribute( 'style', 'position: absolute; right: 4px; top: 4px; font-size: 12px; color: #666666;' );
	this.panel.appendChild( txtVersion );	
};

Splash.prototype.show = function()
{
	this.panel.style.display = 'block';
	this.panels.showPanel( this.panel );
}

Splash.prototype.checkIDELoaded = function()
{
	var elms = document.getElementsByClassName( 'notifier_panel' );
	var self = this;
	if( elms && atom && atom.aozConfig )
	{
		setTimeout(	function()
		{
			self.hide();
		}, 3000 );
		return;
	}
	else
	{
		setTimeout( function()
		{
			self.checkIDELoaded();
		}, 100 );
	}
}

Splash.prototype.keepOpen = function()
{
	if ( this.handleTimeout )
	{
		clearTimeout( this.handleTimeout );
		this.handleTimeout = undefined;
	}
}

Splash.prototype.hide = function()
{
	postUpdater();
	this.panel.style.display = 'none';
	this.panels.destroyPanel( this.panel );
	atom.workspace.element.style.visibility = 'visible';
	//console.clear();
	
	var dirSep = PATH.sep;
	try
	{
		if( FS.existsSync( atom.aozConfig.installInformation.commonPath + dirSep + 'app' + dirSep + 'recompile' ) )
		{

			FS.unlinkSync( atom.aozConfig.installInformation.commonPath + dirSep + 'app' + dirSep + 'recompile' );
			atom.aozConfig.aoz_settings.releaseNotesAtStartup = true;
		}
	}
	catch( e )
	{
		console.warn( e );
	}

	if( atom.aozConfig.aoz_settings.releaseNotesAtStartup == true )
	{
		//atom.aozStudioView.recompileAll( function(){} );
		setTimeout( function()
		{
			atom.commands.dispatch( document.querySelector( '.project-root-header' ), 'tree-view:collapse-all' );			
			if( atom && atom.aozSettings )
			{
				atom.showSettings.show();
			}
		}, 2000 );
		return;
	}
	else
	{
		if( atom.aozConfig.aoz_settings.showDoc === undefined || atom.aozConfig.aoz_settings.showDoc === true )
		{
			atom.docTree.open();
		}

		if( atom.aozConfig.aoz_settings.token == undefined || atom.aozConfig.aoz_settings.token.trim() == '' )
		{
			atom.aozSettingsPanel.show( atom.userConfigPath, 1 );
			return;
		}
		else
		{
			// Licence
			atom.licenceType = 'AOZF';
			atom.tokenChecked = false;
			atom.serialChecked = false;
			atom.authCertChecked = false;
			new AOZCert().setAuthorCertificate( '' );

			if( atom.aozConfig.aoz_settings.token && atom.aozConfig.aoz_settings.token.trim() != '' )
			{
				authenticateToken( atom.aozConfig.aoz_settings.token, function( response )
				{
					if( response.status == 'ok' )
					{
						atom.tokenChecked = true;
						getAuthorCertificate( atom.aozConfig.aoz_settings.token, response.sid, function( res )
						{
							if( res.status == 'ok' )
							{
								atom.aozConfig.aoz_settings.auth_cert = res.cert;
								new AOZCert().setAuthorCertificate( res.cert );
								atom.authCertChecked = true;
							}
							else
							{
								atom.authCertChecked = false;
								atom.aozConfig.aoz_settings.auth_cert = '';
							}

							if( atom.aozConfig.aoz_settings.serial && atom.aozConfig.aoz_settings.serial.trim() != '' )
							{
								checkSerial( atom.aozConfig.aoz_settings.token, atom.aozConfig.aoz_settings.serial, response.sid, function( res )
								{
									if( res.status == 'ok' )
									{
										atom.serialChecked = true ;
										atom.licenceType = res.type;
									}
									else
									{
										atom.serialChecked = false;
										atom.licenceType = 'AOZF';
										atom.aozConfig.aoz_settings.serial = '';
									}
								}, function( err )
								{
									atom.serialChecked = false;
									atom.licenceType = 'AOZF';
									atom.aozConfig.aoz_settings.serial = '';
								} )
							}
						}, function( error )
						{
							atom.authCertChecked = false;
							atom.aozConfig.aoz_settings.auth_cert = '';
						} );
					}
					else
					{
						atom.tokenChecked = false;
						atom.serialChecked = false;
						atom.licenceType = 'AOZF';
						atom.authCertChecked = false;

						atom.aozConfig.aoz_settings.token = '';
						atom.aozConfig.aoz_settings.auth_cert = '';
						atom.aozConfig.aoz_settings.uid = '';
						atom.aozConfig.aoz_settings.serial = '';
						atom.aozSettingsPanel.show( atom.userConfigPath, 1 );
					}
				}, function( error )
				{
					atom.tokenChecked = false;
					atom.serialChecked = false;
					atom.licenceType = 'AOZF';
					atom.authCertChecked = false;
					
					atom.aozConfig.aoz_settings.token = '';
					atom.aozConfig.aoz_settings.auth_cert = '';
					atom.aozConfig.aoz_settings.uid = '';
					atom.aozConfig.aoz_settings.serial = '';
					atom.aozSettingsPanel.show( atom.userConfigPath, 1 );					
				} );
			}			
		}

		try
		{
			if( FS.existsSync( atom.aozConfig.installInformation.commonPath + dirSep + 'app' + dirSep + 'startup' ) )
			{
				atom.aozStudioView.new_file();
			}
		}
		catch( e )
		{
			console.warn( e );
		}		
	}		
}

Splash.prototype.resize = function()
{
	var lf = ( window.innerWidth - 655 ) / 2
	var tp = ( window.innerHeight - 361 ) / 2
	this.panel.style.left = lf + 'px';
	this.panel.style.top = tp + 'px';
}

Splash.IMAGE = 'data:image/png;base64,';

Splash.IMAGE_EDU =
'data:image/png;base64,';
 
module.exports = Splash;
